import React, { Component } from 'react'
import { BrowserRouter, Route } from 'react-router-dom'

import Login from './pages/login'

// virtual root dom
class App extends Component{
    render() {

        return (
            <BrowserRouter>
                <Route path='/login' component={ Login }/>
            </BrowserRouter>
        );

    };
}

export default App;
